import React, { Component } from 'react';
import Header from '../1-Header/AltHeader';
import AltHeader from '../1-Header/Header';
import './KitapKayit.css';
import KitapKayitFormu from './KitapKayitFormu';
import background from '../arkaplan.jpg';

class KitapKayit extends Component {


  render() {
    return (


      <div   style={{
        background: `url(${background})`,
        backgroundSize: 'stretch',
        minHeight: '100vh',
        justifyContent: 'center',
        alignItems: 'center'
      }}>    <AltHeader>              </AltHeader>

              <div className='panel'
            ><KitapKayitFormu> </KitapKayitFormu>               </div>
  <Header>  </Header>
      
      </div>
            

    )
  }
}

export default KitapKayit;
